import React from 'react';

export default function Header() {
    return (<>
        <div className="row d-flex entrance neonText">
            Hey, I'm Michael. <br />
            I like dogs.
            <img src="./images/self.png" alt="self portrait" height="30px" width="30px" />
        </div>

    </>
    )
}
